import React, { Fragment } from 'react'

const SectionLeft = (props) => {
  return (
    <Fragment>
      <h2 className="title-bold">props.title</h2>
      <h3 className="featured-item-subheader italic">props.subtitle</h3>
      <p className="featured-item-body">props.text</p>
    </Fragment>
  )
}

export default SectionLeft;
